import styles from "./Login.module.css"

export default function Login(){
    return(
        <div className={styles.login_container}>
            <form className={styles.login_form}>
                <h1>USER LOGIN</h1>
                <input className={`input_primary ${styles.input}`} placeholder="Username or email..."></input>
                <input className={`input_primary ${styles.input}`} placeholder="Password..."></input>
                <button className={`animated_btn ${styles.btn_submit}`} type="submit"><label>Login</label></button>
            </form>
        </div>
    )
}
